package note;

import java.util.*;
public class Switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner scan = new Scanner(System.in);
		String s = "sdfsffsf";
		s = scan.next();
		switch (s) {
		case "kaiser":
			System.out.println("Hairet");
			break;
		case "Xayim":
			System.out.println("Abu");
			break;
		case "sfaf":
			System.out.println("fsf");
		default:
			System.out.println("Invalid");
		}
	}

}
